import React from "react";
import ReactDom from "react-dom";
//import the css file below

import "./index.css";

const firstTab = () => {
  return <h1 className="fTab">Hiiii</h1>;
};

function BookList() {
  return (
    <section>
      <firstTab></firstTab>
    </section>
  );
}

ReactDom.render(<BookList></BookList>, document.getElementById("root"));
